description:
This Product is a decoded version of Vicmap Crown Land Tenure.  The model has been designed with simplicity of use in mind.  Attributes have been populated with values from the aspatial tables normally supplied with Vicmap Crown Land Tenure. 

Vicmap Crown Land Tenure is a statewide dataset series that plays a key role in the management of Victoria's Crown land.  It was created (June 2003 - Feb 2004) from migrating LCMP layers into the Vicmap structure.

Datasets in the series are listed below.  See their metadata entries for more detailed metadata.

Tenure polygons and descriptors as per Crown Land Management - Vicmap Crown Land Tenure (Basic) (CL_TENURE_POLYGON_DC);
Government Roads as per Crown Land Management - Vicmap Crown Land Tenure (GOV_ROAD_POLYGON_DC);
Apiary rights and Bee farm and range licences are in their own dataset - Crownland.Apiary, which is not included in this dataset.

The On Track Survey is conducted in April-May and involves a short telephone survey of school leavers who attended school in the previous year and who agreed to participate in the survey. 
The On Track survey seeks to: 
Offer a consistent and comprehensive approach to monitoring the transistions of school leavers; 
Report the information to schools, TAFE institutions and other education providers, organisations concerned with assisting young people, policy makers, parents and students; 
Provide detailed analyses of the transistions experienced by different groups of leavers; 
Enable education providers to use the findings to monitor and improve their programs; and 
Provide a referral service for school leavers who appear to be experiencing difficulties in the transistion process.  Results for individual schools are usually published in June of the survey year.

The Australian Government Department of Jobs and Small Business publishes a range of labour market data on its Labour Market Information Portal website (lmip.gov.au).

The link below provides data for the boundaries used by the Department in its administration of jobactive. These boundaries are known as Employment Regions. The data provided includes:

* jobactive caseload data (Australian Government Department of Employment administrative data);
* Centrelink administrative data - Australian Government Department of Employment extract;
* Unemployment rates (Australian Bureau of Statistics Labour Force Survey data and Australian Government Department of Employment estimates, derived from Small Area Labour Markets estimates);
* Employment by industry and occupation (Australian Bureau of Statistics Labour Force Survey data and Census of Population and Housing data);
* Population by age group data (Australian Bureau of Statistics Labour Force Survey data and Australian Bureau of Statistics Estimated Resident Population).
